import React from 'react';
import './UsersData.css';

const UsersData = () => {
  const data = [
    {
      username: 'johndoe',
      firstName: 'John',
      lastName: 'Doe',
      dob: '01/01/1990',
      phone: '123-456-7890',
      password: 'password1'
    },
    {
      username: 'janedoe',
      firstName: 'Jane',
      lastName: 'Doe',
      dob: '02/14/1992',
      phone: '098-765-4321',
      password: 'password2'
    }
  ];
  return (
    <div className='UsersDataPage'>
      <h1>Users Data</h1>
      <div className='UsersDataTable'>
        <table>
          <thead>
            <tr>
              <th>Username</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Date of Birth</th>
              <th>Phone Number</th>
              <th>Password</th>
            </tr>
          </thead>
          <tbody>
            {data.map((user) => (
              <tr key={user.username}>
                <td>{user.username}</td>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{user.dob}</td>
                <td>{user.phone}</td>
                <td>{user.password}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default UsersData;
